import React from 'react';
import ReactDOM from 'react-dom';

const myfirstelement = <h1>Hello World!</h1>

const myelement = (
  <table>
    <tr>
      <th>Name</th>
    </tr>
    <tr>
      <td>John</td>
    </tr>
    <tr>
      <td>Elsa</td>
    </tr>
  </table>
);

const exp = (
  <h1>I am a Header.</h1>
);

//To get a text box
const enter = <input type="text" />;


ReactDOM.render(enter, document.getElementById('sandy'));
